  input: "TEXT\x1CC00111278\x1CTEXT.1\x1C\x1CF3XA\x1CPlease accept this amendment
    in response to the current RFAI received by the NRTL PAC. As requested, all changes
    have been made. On point 3, NRTL amended the data entry and there are now descriptions
    as required. On Point 4, the dates have been corrected and all of the IEs in question
    disseminated one day before the respective elections, therefore, not requiring
    a 24 hour report. On Point 5, we understood that the IEs made the day before the
    election did not trigger a 24 hour notice. If this is not the case, please help
    us determine what the next best steps should be as well as for future reporting
    purposes.    In reference to our best efforts practice, NRTL runs a query each
    week to capture all PAC gifts that aggregate to $200 and over in the calendar
    year. For all donors that equal or exceed that amount, we send a letter requesting
    employment/occupation information as required. If we do not have any response
    to the 1st letter after a month, we send a second request.\x1C\n"
